interface TimeLineData{
  dateTime :String;
  title : String;
  detail : String | JSX.Element; 
} 

function timeLineItem(data:TimeLineData):JSX.Element {

  let detail :JSX.Element =data.detail instanceof String?  
  <Typography align="left">{data.detail}</Typography> : 
  data.detail;
 

  return(
     <TimelineItem>
          <TimelineOppositeContent>
          <div className={styles.dateColor}>
            {data.dateTime}
            </div>
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot variant="outlined"/>
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
 {data.title}
 <br></br>
  {detail}
          </TimelineContent>
          </TimelineItem>
  );
}

